import React from "react";
import CloseIcon from "@mui/icons-material/Close";
import MenuIcon from "@mui/icons-material/Menu";

const Menu = () => {
  return (
    <div className="relative md:hidden p-5 bg-blue-500">
      <MenuIcon fontSize="large" className="cursor-pointer absolute" />
      <CloseIcon fontSize="large" className="cursor-pointer absolute" />
    </div>
  );
};

export default Menu;
